import React from "react";
import Header from "./Header";
import Footer from "./Footer";
import Note from "./Note";
import notes from "../notes";



function App(){
    return (
        <div>
        {notes.map(props =>{
            <Header  
            title={props.title}
            content={props.content}
            />
        })}
        <Note/>
        <Footer/>
        </div>

    );
}

export default App;
